INSERT INTO `wp_wc_admin_notes` VALUES (1,'wc-admin-add-first-product-note','email','en_US','Add your first product','{greetings}<br /><br />Nice one; you\'ve created a WooCommerce store! Now it\'s time to add your first product and get ready to start selling.<br /><br />There are three ways to add your products: you can <strong>create products manually, import them at once via CSV file</strong>, or <strong>migrate them from another service</strong>.<br /><br /><a href=\"https://woocommerce.com/document/managing-products/?utm_source=help_panel&amp;utm_medium=product\">Explore our docs</a> for more information, or just get started!','{\"role\":\"administrator\"}','unactioned','woocommerce-admin','2022-12-13 22:07:38',NULL,0,'plain','http://localhost/goddess-shape.com/wp-content/plugins/woocommerce/images/admin_notes/dashboard-widget-setup.png',0,0,'info'),(2,'wc-admin-adding-and-managing-products','info','en_US','Adding and Managing Products','Learn more about how to set up products in WooCommerce through our useful documentation about adding and managing products.','{}','unactioned','woocommerce-admin','2022-12-13 22:07:38',NULL,0,'plain','',0,0,'info'),(3,'wc-admin-choosing-a-theme','marketing','en_US','Choosing a theme?','Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.','{}','unactioned','woocommerce-admin','2022-12-13 22:07:38',NULL,0,'plain','',0,0,'info'),(4,'wc-admin-insight-first-product-and-payment','survey','en_US','Insight','More than 80% of new merchants add the first product and have at least one payment method set up during the first week.<br><br>Do you find this type of insight useful?','{}','unactioned','woocommerce-admin','2022-12-13 22:07:38',NULL,0,'plain','',0,0,'info'),(5,'wc-admin-marketing-jetpack-backup','marketing','en_US','Protect your WooCommerce Store with Jetpack Backup.','Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.','{}','unactioned','woocommerce-admin-notes','2022-12-13 22:07:38',NULL,0,'thumbnail','http://localhost/goddess-shape.com/wp-content/plugins/woocommerce/assets/images/admin_notes/marketing-jetpack-2x.png',0,0,'info'),(6,'wc-admin-mobile-app','info','en_US','Install Woo mobile app','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics  wherever you are.','{}','unactioned','woocommerce-admin','2022-12-13 22:07:38',NULL,0,'plain','',0,0,'info'),(7,'new_in_app_marketplace_2021','info','en_US','Customize your store with extensions','Check out our NEW Extensions tab to see our favorite extensions for customizing your store, and discover the most popular extensions in the WooCommerce Marketplace.','{}','unactioned','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(8,'wayflyer_bnpl_q4_2021','marketing','en_US','Grow your business with funding through Wayflyer','Fast, flexible financing to boost cash flow and help your business grow  one fee, no interest rates, penalties, equity, or personal guarantees. Based on your stores performance, Wayflyer provides funding and analytical insights to invest in your business.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(9,'wc_shipping_mobile_app_usps_q4_2021','marketing','en_US','Print and manage your shipping labels with WooCommerce Shipping and the WooCommerce Mobile App','Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a>  all directly from your mobile device!','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(10,'woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store \"ready to sell\" as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(11,'your-first-product','info','en_US','Your first product','Thats huge! Youre well on your way to building a successful online store  now its time to think about how youll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(12,'wc-admin-optimizing-the-checkout-flow','info','en_US','Optimizing the checkout flow','Its crucial to get your stores checkout as smooth as possible to avoid losing sales. Lets take a look at how you can optimize the checkout experience for your shoppers.','{}','unactioned','woocommerce.com','2023-03-29 22:22:24',NULL,0,'plain','',0,0,'info'),(13,'wc-payments-qualitative-feedback','info','en_US','WooCommerce Payments setup - let us know what you think','Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(14,'share-your-feedback-on-paypal','info','en_US','Share your feedback on PayPal','Share your feedback in this 2 minute survey about how we can make the process of accepting payments more useful for your store.','{}','unactioned','woocommerce.com','2023-03-29 22:22:24',NULL,0,'plain','',0,0,'info'),(15,'google_listings_and_ads_install','marketing','en_US','Drive traffic and sales with Google','Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(16,'wc-subscriptions-security-update-3-0-15','info','en_US','WooCommerce Subscriptions security update!','We recently released an important security update to WooCommerce Subscriptions. To ensure your sites data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href=\"https://woocommerce.com/my-dashboard\">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help  just <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">open a ticket</a>.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(17,'woocommerce-core-update-5-4-0','info','en_US','Update to WooCommerce 5.4.1 now','WooCommerce 5.4.1 addresses a checkout issue discovered in WooCommerce 5.4. We recommend upgrading to WooCommerce 5.4.1 as soon as possible.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(18,'wcpay-promo-2020-11','marketing','en_US','wcpay-promo-2020-11','wcpay-promo-2020-11','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(19,'wcpay-promo-2020-12','marketing','en_US','wcpay-promo-2020-12','wcpay-promo-2020-12','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(20,'ppxo-pps-upgrade-paypal-payments-1','info','en_US','Get the latest PayPal extension for WooCommerce','Heads up! Theres a new PayPal on the block!<br /><br />Now is a great time to upgrade to our latest <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal extension</a> to continue to receive support and updates with PayPal.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, and pay later options with the all-new PayPal extension for WooCommerce.','{}','unactioned','woocommerce.com','2023-03-29 22:22:24',NULL,0,'plain','',0,0,'info'),(21,'ppxo-pps-upgrade-paypal-payments-2','info','en_US','Upgrade your PayPal experience!','Get access to a full suite of PayPal payment methods, extensive currency and country coverage, offer subscription and recurring payments, and the new PayPal pay later options.<br /><br />Start using our <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">latest PayPal today</a> to continue to receive support and updates.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(22,'woocommerce-core-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(23,'woocommerce-blocks-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(24,'woocommerce-core-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(25,'woocommerce-blocks-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(26,'habit-moment-survey','marketing','en_US','Were all ears! Share your experience so far with WooCommerce','Wed love your input to shape the future of WooCommerce together. Feel free to share any feedback, ideas or suggestions that you have.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(27,'ecomm-wc-navigation-survey','info','en_US','Wed like your feedback on the WooCommerce navigation','Were making improvements to the WooCommerce navigation and would love your feedback. Share your experience in this 2 minute survey.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(28,'woocommerce-core-paypal-march-2022-updated','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy PayPal Standard security updates for stores running WooCommerce (version 3.5 to 6.3). Its recommended to disable PayPal Standard, and use <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal Payments</a> to accept PayPal.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(29,'woocommerce-core-paypal-march-2022-updated-nopp','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy security updates related to PayPal Standard payment gateway for stores running WooCommerce (version 3.5 to 6.3).','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(30,'pinterest_03_2022_update','marketing','en_US','Your Pinterest for WooCommerce plugin is out of date!','Update to the latest version of Pinterest for WooCommerce to continue using this plugin and keep your store connected with Pinterest. To update, visit <strong>Plugins &gt; Installed Plugins</strong>, and click on update now under Pinterest for WooCommerce.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(31,'store_setup_survey_survey_q2_2022','survey','en_US','How is your store setup going?','Our goal is to make sure you have all the right tools to start setting up your store in the smoothest way possible.\r\nWed love to know if we hit our mark and how we can improve. To collect your thoughts, we made a 2-minute survey.','{}','unactioned','woocommerce.com','2022-12-17 23:55:12',NULL,0,'plain','',0,0,'info'),(32,'wc-admin-wisepad3','marketing','en_US','Take your business on the go in Canada with WooCommerce In-Person Payments','Quickly create new orders, accept payment in person for orders placed online, and automatically sync your inventory  no matter where your business takes you. With WooCommerce In-Person Payments and the WisePad 3 card reader, you can bring the power of your store anywhere.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(33,'woocommerce-payments-august-2022-need-to-update','update','en_US','Action required: Please update WooCommerce Payments','An updated secure version of WooCommerce Payments is available  please ensure that youre using the latest patch version. For more information on what action you need to take, please review the article below.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(34,'woocommerce-payments-august-2022-store-patched','update','en_US','WooCommerce Payments has been automatically updated','Youre now running the latest secure version of WooCommerce Payments. Weve worked with the WordPress Plugins team to deploy a security update to stores running WooCommerce Payments (version 3.9 to 4.5). For further information, please review the article below.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(35,'woocommerce_admin_deprecation_q4_2022','info','en_US','WooCommerce Admin is part of WooCommerce!','To make sure your store continues to run smoothly, check that WooCommerce is up-to-date  at least version 6.5  and then disable the WooCommerce Admin plugin.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(36,'tiktok-targeted-q4-2022','marketing','en_US','Get $200 in ad credit from TikTok after you spend $20 on your first campaign','Reach one billion shoppers with TikTok for WooCommerce this holiday season! Sync your product catalog, capture insights, and create ad campaigns right from your dashboard. Connect your store today to unlock this limited time offer! <a href=\"https://ads.tiktok.com/help/article?aid=10011326\">Terms &amp; conditions apply</a>.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(37,'paypal_paylater_g3_q4_22','marketing','en_US','Turn browsers into buyers with Pay Later','Add PayPal at checkout, plus give customers a buy now, pay later option from the name they trust. With Pay in 4 &amp; Pay Monthly, available in PayPal Payments, you get paid up front while letting customers spread their payments over time. Boost your average order value and convert more sales  at no extra cost to you.','{}','unactioned','woocommerce.com','2022-12-16 05:03:29',NULL,0,'plain','',0,0,'info'),(38,'paypal_paylater_g2_q4_22','marketing','en_US','Upgrade to PayPal Payments to offer Pay Later at checkout','PayPal Pay Later is included in PayPal Payments at no additional cost to you. Customers can spread their payments over time while you get paid up front. \r\nTheres never been a better time to upgrade your PayPal plugin. Simply download it and connect with a PayPal Business account.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(39,'google_listings_ads_custom_attribute_mapping_q4_2022','marketing','en_US','Our latest improvement to the Google Listings & Ads extension: Attribute Mapping','You spoke, we listened. This new feature enables you to easily upload your products, customize your product attributes in one place, and target shoppers with more relevant ads. Extend how far your ad dollars go with each campaign.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(40,'wc-admin-manualauthcapture','marketing','en_US','Miss fewer manual payments in WooCommerce Payments','Using WooCommerce Payments to manually authorize and capture payments? Weve introduced a simplified and more efficient process, so you can miss fewer payments and continue to grow your revenue.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(41,'apple_pay_square_q422','marketing','en_US','Grow your business with Apple Pay','Start boosting your online conversions today with Apple Pay  shoppers can safely complete a purchase with a touch or a glance and are more likely to come back. Enable Apple Pay with Square by selecting  Settings &gt; Payments &gt; Square.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(42,'apple_pay_wcpay_q422','marketing','en_US','Grow your business with Apple Pay','Start boosting your online conversions today with Apple Pay  shoppers can safely complete a purchase with a touch or a glance and are more likely to come back. Confirm Apple Pay is enabled by selecting Payments &gt; Settings and making sure Enable express checkouts is checked.','{}','pending','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(43,'meta-noFB-dec-q4-2022','marketing','en_US','Create highly targeted Facebook ads with Facebook for WooCommerce','Sync your product catalog to create Facebook ads and track their performance  all from within your WooCommerce dashboard. With improved tracking signals and speed, plus more accurate tracking with the introduction of Metas Conversion API, youll have all the tools you need to run effective ad campaigns.','{}','unactioned','woocommerce.com','2022-12-13 22:07:39',NULL,0,'plain','',0,0,'info'),(44,'wc-refund-returns-page','info','en_US','Setup a Refund and Returns Policy page to boost your store\'s credibility.','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.','{}','unactioned','woocommerce-core','2022-12-13 22:07:40',NULL,0,'plain','',0,0,'info'),(45,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','{}','unactioned','woocommerce-admin','2022-12-13 22:07:41',NULL,0,'plain','',0,0,'info'),(46,'wc-admin-onboarding-payments-reminder','info','en_US','Start accepting payments on your store!','Take payments with the provider thats right for you - choose from 100+ payment gateways for WooCommerce.','{}','unactioned','woocommerce-admin','2022-12-15 06:20:23',NULL,0,'plain','',0,0,'info'),(47,'storefront-customize','info','en_US','Design your store with Storefront ','Visit the Storefront settings page to start setup and customization of your shop.','{}','unactioned','storefront','2022-12-15 19:34:27',NULL,0,'plain','',0,0,'info'),(48,'wc-admin-insight-first-sale','survey','en_US','Did you know?','A WooCommerce powered store needs on average 31 days to get the first sale. You\'re on the right track! Do you find this type of insight useful?','{}','unactioned','woocommerce-admin','2022-12-17 23:55:11',NULL,0,'plain','',0,0,'info'),(49,'wc-admin-usage-tracking-opt-in','info','en_US','Help WooCommerce improve with usage tracking','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"https://localhost/goddess-shape.com/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking?utm_medium=product\" target=\"_blank\">Read more</a> about what data we collect.','{}','unactioned','woocommerce-admin','2022-12-17 23:55:11',NULL,0,'plain','',0,0,'info'),(50,'wc-admin-woocommerce-payments','marketing','en_US','Try the new way to get paid','Securely accept credit and debit cards on your site. Manage transactions without leaving your WordPress dashboard. Only with <strong>WooCommerce Payments</strong>.<br><br>By clicking \"Get started\", you agree to our <a href=\"https://wordpress.com/tos/\" target=\"_blank\">Terms of Service</a>','{}','actioned','woocommerce-admin','2022-12-17 23:55:11',NULL,0,'plain','',0,0,'info'),(51,'needs-update-eway-payment-gateway-rin-2022-12-20','update','en_US','Security vulnerability patched in WooCommerce Eway Gateway','In response to a potential vulnerability identified in WooCommerce Eway Gateway versions 3.1.0 to 3.5.0, weve worked to deploy security fixes and have released an updated version.\r\nNo external exploits have been detected, but we recommend you update to your latest supported version 3.1.26, 3.2.3, 3.3.1, 3.4.6, or 3.5.1','{}','pending','woocommerce.com','2023-01-17 17:35:29',NULL,0,'plain','',0,0,'info'),(52,'updated-eway-payment-gateway-rin-2022-12-20','update','en_US','WooCommerce Eway Gateway has been automatically updated','Your store is now running the latest secure version of WooCommerce Eway Gateway. We worked with the WordPress Plugins team to deploy a software update to stores running WooCommerce Eway Gateway (versions 3.1.0 to 3.5.0) in response to a security vulnerability that was discovered.','{}','pending','woocommerce.com','2023-01-17 17:35:29',NULL,0,'plain','',0,0,'info'),(53,'storeediting_feedback_jan_2023','marketing','en_US','Tell us what you need to customize your store!','We need your feedback. Please spare a few minutes to share your input on what is most important to you when designing and customizing your storefront to help us build the features you need.','{}','unactioned','woocommerce.com','2023-01-17 17:35:29',NULL,0,'plain','',0,0,'info'),(54,'ecomm-wc-navigation-survey-2023','info','en_US','Navigating WooCommerce on WordPress.com','We are improving the WooCommerce navigation on WordPress.com and would love your help to make it better! Please share your experience with us in this 2-minute survey.','{}','pending','woocommerce.com','2023-01-17 17:35:29',NULL,0,'plain','',0,0,'info'),(55,'wc-payments-notes-set-up-refund-policy','info','en_US','Set up refund policy','Protect your merchant account from fraudulent disputes by defining the policy and making it accessible to customers.','{}','unactioned','woocommerce-payments','2023-01-20 04:10:48',NULL,0,'plain','',0,0,'info'),(56,'wc-payments-notes-set-https-for-checkout','info','en_US','Enable secure checkout','Enable HTTPS on your checkout pages to display all available payment methods and protect your customers data.','{}','unactioned','woocommerce-payments','2023-01-20 04:10:48',NULL,0,'plain','',0,0,'info'),(57,'wc-admin-real-time-order-alerts','info','en_US','Get real-time order alerts anywhere','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.','{}','unactioned','woocommerce-admin','2023-03-15 16:47:16',NULL,0,'plain','',0,0,'info'),(58,'affirm_q1_2023','marketing','en_US','Turn more browsers into buyers with flexible payments','When you offer flexible payment options to shoppers, they\'re more likely to convert. Its why businesses offering Affirm see an average order value lift of 63%. Affirm tailors your store\'s payment options with terms proven to reach new customers, boost conversions, and grow sales.','{}','unactioned','woocommerce.com','2023-03-15 16:47:16',NULL,0,'plain','',0,0,'info'),(59,'google_listings_ads_pmax_i1_q1_2023_no_gla','marketing','en_US','Create more engaging ads  without the hard work','Get in front of millions of shoppers searching for products like yours with Google Listings &amp; Ads. With new customization features, Google automatically tests multiple combinations of text and images to create the most engaging ad to boost your business. Plus, get up to $500 in ad credit  terms and conditions apply.','{}','unactioned','woocommerce.com','2023-03-29 00:33:15',NULL,0,'plain','',0,0,'info'),(60,'google_listings_ads_pmax_i1_q1_2023_with_gla','marketing','en_US','New customization features to boost your business','You can now add custom images, messaging, and URLs to campaigns in Google Listings &amp; Ads. Google then automatically tests multiple combinations to create the most engaging version to help boost your business. Get more sales with dynamic content  edit an existing campaign or create a new ad now.','{}','pending','woocommerce.com','2023-03-29 00:33:15',NULL,0,'plain','',0,0,'info'),(61,'woocommerce-wcpay-march-2023-update-needed','update','en_US','Action required: Security update for WooCommerce Payments','<strong>Your store requires a security update for WooCommerce Payments</strong>. Please update to the latest version of WooCommerce Payments immediately to address a potential vulnerability discovered on March 22. For more information on how to update, visit this WooCommerce Developer Blog Post.','{}','unactioned','woocommerce.com','2023-03-29 00:33:15',NULL,0,'plain','',0,0,'info'),(62,'ppcp-disable-ppxo-note','info','en_US','Action Required: Deactivate PayPal Checkout','As of 1 Sept 2021, PayPal Checkout will be officially retired from WooCommerce.com, and support for this product will end as of 1 March 2022. To fully switch over, all you need to do is deactivate and/or remove the PayPal Checkout plugin from your store.','{}','actioned','woocommerce-paypal-payments','2023-03-29 22:22:58',NULL,0,'plain','',0,0,'info'),(63,'wc-admin-launch-checklist','info','en_US','Ready to launch your store?','To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.','{}','unactioned','woocommerce-admin','2023-03-30 17:51:51',NULL,0,'plain','',0,0,'info'),(64,'tap_to_pay_iphone_q2_2023_no_wcpay','marketing','en_US','Accept in-person contactless payments on your iPhone','Tap to Pay on iPhone and WooCommerce Payments is quick, secure, and simple to set up  no extra terminals or card readers are needed. Accept contactless debit and credit cards, Apple Pay, and other NFC digital wallets in person.','{}','pending','woocommerce.com','2023-04-04 20:54:04',NULL,0,'plain','',0,0,'info'),(65,'tap_to_pay_iphone_q2_2023_with_wcpay','marketing','en_US','New: accept in-person contactless payments on your iPhone','Tap to Pay on iPhone is quick, secure, and simple to set up in WooCommerce Payments  no extra terminals or card readers are needed. Accept contactless debit and credit cards, Apple Pay, and other NFC digital wallets in person in a few short steps!','{}','unactioned','woocommerce.com','2023-04-04 20:54:04',NULL,0,'plain','',0,0,'info');
